import '../components.css'
import Header from "../components/header";
import { useState } from 'react';
import axios from 'axios';

const PostJob = () => {

  const [jobTitle, setJobTitle] = useState('');
  const [shortJobDescription, setShortJobDescription] = useState('');
  const [fullJobDescription, setFfullJobDescription] = useState('');

  const formData = {job_title: jobTitle, short_job_description: shortJobDescription, full_job_description: fullJobDescription}

    console.log(formData);

    const submitForm = (event) =>{
      event.preventDefault()

      axios.post('http://127.0.0.1:1111/api/v1/post-job/', formData).then((res) => {
        console.log("success");
      }).catch((error) => {
        console.log(error)
      })
    }



    return(
        <>
        <Header />

        <div className="login-container">
        <h1 style={{ marginBottom: '20px' }}>Looking to hire someone? <br /> Create a New Job Post Here</h1>

        <form action="" method="">
          <input onChange={(e) => {setJobTitle(e.target.value)}}  type="text" name="job_title" placeholder="job title"></input> <br />
          <input onChange={(e) => {setShortJobDescription(e.target.value)}} type="text" name="short_job_description" placeholder="short job description"></input><br />
          <input onChange={(e) => {setFfullJobDescription(e.target.value)}} type="text" name="full_job_description" placeholder="full job description"></input><br />

          <button onClick={submitForm} className="register-button">Submit</button>
        </form>

        </div>

        </>

    );
}

export default PostJob;
